import React, { useState, useEffect } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import axios from 'axios';
import { toast } from 'react-toastify';
import 'react-toastify/dist/ReactToastify.css';
import './css/main.css';

export default function NavBar() {
    const [menuOpen, setMenuOpen] = useState(false);
    const [darkMode, setDarkMode] = useState(false);
    const [userInfo, setUserInfo] = useState(null);
    const navigate = useNavigate();

    useEffect(() => {
        const storedUser = localStorage.getItem('user');
        if (storedUser) {
            setUserInfo(JSON.parse(storedUser));
        }
    }, []);

    useEffect(() => {
        const fetchSession = async () => {
            try {
                const res = await axios.get('http://localhost:8080/users/ses', { withCredentials: true });
                setUserInfo(res.data);
                localStorage.setItem('user', JSON.stringify(res.data));
            } catch (err) {
                console.log('ÏÑ∏ÏÖò ÏóÜÏùå, localStorage Ï†ïÎ¶¨');
                localStorage.removeItem('user');
                setUserInfo(null);
            }
        };
        
        fetchSession();
    }, []);

    useEffect(() => {
        console.log('userInfo Î≥ÄÍ≤Ω:', userInfo);
    }, [userInfo]);

    useEffect(() => {
        document.documentElement.setAttribute('data-theme', darkMode ? 'dark' : 'light');
    }, [darkMode]);

    useEffect(() => {
        document.body.style.overflow = menuOpen ? 'hidden' : '';
    }, [menuOpen]);

    const handleLogout = async () => {
        try {
            await axios.post( 

                'http://localhost:8080/users/logout',
                new URLSearchParams({ user_id: userInfo.user_id }),
                {
                    headers: { 'Content-Type': 'application/x-www-form-urlencoded' },
                    withCredentials: true,
                }
            );

            localStorage.removeItem('user');
            toast.success('Î°úÍ∑∏ÏïÑÏõÉ ÎêòÏóàÏäµÎãàÎã§!');
            setUserInfo(null);

            setTimeout(() => {
                navigate('/');
            }, 1000);
        } catch (err) {
            console.error('Î°úÍ∑∏ÏïÑÏõÉ Ïã§Ìå®:', err);
            toast.error('Î°úÍ∑∏ÏïÑÏõÉ Ï§ë Ïò§Î•òÍ∞Ä Î∞úÏÉùÌñàÏäµÎãàÎã§.');
        }
    };

    return (
        <>
            <nav className="glass-navbar">
                <div className="navbar-container">
                    <div className="navbar-left">
                        <Link to="/" className="logo">üçΩ <span>FoodyChat</span></Link>
                    </div>

                    <div className="navbar-center desktop-menu">
                        <Link to="/chatbot" className="nav-link">ü§ñ <span>Ï±óÎ¥á</span></Link>
                        <Link to="/image-analysis" className="nav-link">üç± <span>Ïù¥ÎØ∏ÏßÄ Î∂ÑÏÑù</span></Link>
                        <Link to="/mypage" className="nav-link">üç± <span>ÎßàÏù¥ÌéòÏù¥ÏßÄ</span></Link>
                        {userInfo && userInfo.membership_level === 'admin' && (
                            <Link to="/users/admin" className="nav-link">üç± <span>Í¥ÄÎ¶¨ÏûêÌéòÏù¥ÏßÄ</span></Link>
                        )}
                    </div>

                    <div className="navbar-right desktop-menu">
                        {userInfo ? (
                            <>
                                <button onClick={handleLogout}>Î°úÍ∑∏ÏïÑÏõÉ</button>
                            </>
                        ) : (
                            <>
                                <Link to="/login" className="nav-button">Î°úÍ∑∏Ïù∏</Link>
                                <Link to="/signup" className="nav-button signup">ÌöåÏõêÍ∞ÄÏûÖ</Link>
                            </>
                        )}
                        <button
                            className="darkmode-toggle"
                            onClick={() => setDarkMode(!darkMode)}
                            aria-label="Dark mode toggle"
                        >
                            {darkMode ? '‚òÄÔ∏è' : 'üåô'}
                        </button>
                    </div>

                    <div
                        className={`hamburger ${menuOpen ? 'open' : ''}`}
                        onClick={() => setMenuOpen(!menuOpen)}
                        aria-label="Menu toggle"
                    >
                        <span />
                        <span />
                        <span />
                    </div>
                </div>
            </nav>

            <div className={`mobile-menu ${menuOpen ? 'show' : ''}`}>
                <Link to="/chatbot" onClick={() => setMenuOpen(false)}>ü§ñ Ï±óÎ¥á</Link>
                <Link to="/image-analysis" onClick={() => setMenuOpen(false)}>üç± Ïù¥ÎØ∏ÏßÄ Î∂ÑÏÑù</Link>
                <Link to="/mypage" onClick={() => setMenuOpen(false)}>üç± ÎßàÏù¥ÌéòÏù¥ÏßÄ</Link>
                {userInfo && userInfo.membership_level === 'admin' && (
                    <Link to="/users/admin" onClick={() => setMenuOpen(false)}>üç± Í¥ÄÎ¶¨ÏûêÌéòÏù¥ÏßÄ</Link>
                )}
                {userInfo ? (
                    <button onClick={() => { setMenuOpen(false); handleLogout(); }} className="mobile-logout-button">
                        Î°úÍ∑∏ÏïÑÏõÉ
                    </button>
                ) : (
                    <>
                        <Link to="/login" onClick={() => setMenuOpen(false)}>Î°úÍ∑∏Ïù∏</Link>
                        <Link to="/signup" onClick={() => setMenuOpen(false)}>ÌöåÏõêÍ∞ÄÏûÖ</Link>
                    </>
                )}
            </div>
        </>
    );
}
